t,p.contentType=l,p.slug="modern-react",p.content=t,p.createdAt=new Date(1552011647e3),p.updatedAt=new Date(1573230315233),p.title="现代的 React",p.layout=a,p.categories=[n],p.date="2019-03-08 10:20:47",p.tags=i,p.markdownHeadings=[],p.excerpt="<p>我一直很想写一本关于 React 的小书，因为我看到很多刚入门前端或刚开始使用 React 的开发者，对 React 有一些误解。也许是因为 JSX, 让很多人误以为 React 是一种黑魔法 —— 竟然能在 JS 文件里写 HTML! 还有很多围绕 React 的问题，像「状态管理」，就让很多人焦头烂额了。也正是因为 JSX, 让很多人依然用模板的思维去写 React.</p>\n",p.permalink="/blog/modern-react",p.assets={},p.attributes=p,d.type=a,d.internal=t,d.contentType=l,d.slug="trick-for-reading-source-code",d.content=t,d.createdAt=new Date(1536905647e3),d.updatedAt=new Date(1573230315237),d.title="一个阅读源代码的技巧",d.layout=a,d.date="2018-09-14 14:14:07",d.categories=[n],d.tags=i,d.markdownHeadings=[],d.excerpt="<p>昨天和朋友聊到阅读开源代码，我分享了自己一个读代码的技巧，就是从第一个 commit 开始读。</p>\n",d.permalink="/blog/trick-for-reading-source-code",d.assets={},d.attributes=d,v.type=a,v.internal=t,v.contentType=l,v.slug="announcing-serlina",v.content=t,v.createdAt=new Date(1534153449e3),v.updatedAt=new Date(1573230315231),v.title="Serlina: 渐进式的 React 服务器渲染框架",v.date="2018-08-13 17:44:09",v.categories=[n],v.layout=a,v.markdownHeadings=[{text:"起因",slug:"起因",level:2},{text:x,slug:x,level:2},{text:"在 Egg 中使用",slug:"在-egg-中使用",level:2},{text:b,slug:b,level:2},{text:"和 Next.js 有什么区别",slug:"和-next-js-有什么区别",level:3}],v.excerpt="<p>副标题: 《可能是最适合 Egg 的 React Serverside-rendering 方案》</p>\n",v.permalink="/blog/announcing-serlina",v.assets={},v.attributes=v,w.type="page",w.internal=t,w.contentType="default",w.isCategoryPage=r,w.layout="category",w.permalink="/categories/coding",w.slug="coding",w.createdAt=m,w.updatedAt=m,w.posts=[g,c,p,d,v,u,k,A,h,C,R],w.pagination={hasPrev:!1,hasNext:!1,total:1,current:1,prevLink:"/categories/coding/page/2",nextLink:t},w.category=n,w.assets={},w.attributes=w,w.content=t,k.type=a,k.internal=t,k.contentType=l,k.slug="gitlab-ci-runner",k.content=t,k.createdAt=new Date(1492690662e3),k.updatedAt=new Date(1573230315232),k.ti